cordova.define("com.jiedaibao.trackevent.TrackEvent", function (require, exports, module) {
   var exec = require('cordova/exec');
   module.exports = {
       trackEvent : function(key, successCallback, errorCallback) {
       exec(
            successCallback,
            errorCallback,
            'TrackEvent',
            'trackEvent',
            [{
             "key": key
             }]
            );
       }
    }
  }
);
